import React from "react";
import styles from "./location.module.scss";
import {useRouter} from "next/router";
import axios from "axios";
import {ContainerCard} from "../../../components/containerCard/ContainerCard.js";

const BASE_URL = "http://localhost:3400/api";
function fetchContainers(body) {
  return axios.post(`${BASE_URL}/containers/getcontainers`, body);
}

export default function locationValue() {
  const router = useRouter();

  const routerObject = router;
  console.log(routerObject);
  const {location} = routerObject.query;

  fetchContainers({location}).then((response) => {
    console.log(response);
  });

  return (
    <main className={styles.main}>
      <div className={styles.wrapper}>
        <h1 className={styles.h1}>Tillg√§ngliga containrar i {location}</h1>
        <ContainerCard />
      </div>
    </main>
  );
}
